import React from "react";
import CourseNavbar from "./CourseNavbar";
import CourseList from "./CourseList";

const CourseManagement = () => {
  const [courseList, setCourseList] = React.useState();

  return (
    <div>
      <CourseNavbar />
      <CourseList />
    </div>
  );
};

export default CourseManagement;
